import { NavLink, Route, Routes } from "react-router-dom";
import CreatePortfolio from "./components/CreatePortfolio";
import PaperTrade from "./PaperTrade";
import Home from "./components/Home";
import { useState } from "react";
import { userID } from "./interfaces";

const initialUserID = {
  _id: {
    $oid: "61e83b060f564c8939df653d",
  },
};

export default function App() {
  const [userID, setUserID] = useState(initialUserID);

  function handleID(userID: string) {
    setUserID({
      _id: {
        $oid: userID,
      },
    });
  }

  return (
    // this.handleID = this.handleID.bind(this);
    <div>
      <Routes>
        <Route
          path="*"
          element={<Home userID={userID._id.$oid} handleID={handleID} />}
        />
        {/* <Route path="/createportfolio" element={<CreatePortfolio />} /> */}
        {/* <Route path="/dashboard" element={<PaperTrade userID={userID} />} /> */}
      </Routes>
    </div>
  );
}
